@Override
public void process(TriggerEvent event) {
  eventRef.set(event);
  getActionStarted().countDown();
  try {
    Thread.sleep(5000);
    triggerFired.compareAndSet(false, true);
    getActionCompleted().countDown();
  } catch (InterruptedException e) {
    getActionInterrupted().countDown();
    return;
  }
}

